import './App.css';
import { Route, Routes } from 'react-router-dom';
import Home from './pages/Home';
import Navbar from './pages/homecomponents/Navbar';
import Topbar from './pages/homecomponents/Topbar';
import Footer from './pages/homecomponents/Footer';

function App() {
  return (
    <div>
      <Routes>
        {/* Website Routes */}
        <Route path='/' element={<>
          <Topbar />
          <Navbar />
          <Home />
          <Footer/>
        </>} />
        <Route path='/about-us' element={<div>Hello</div>} />
        <Route path='/contact-us' element={<div>Hello</div>} />
        <Route path='/Drive-with-assar' element={<div>Hello</div>} />
        <Route path='/Franchise' element={<div>Hello</div>} />
        <Route path='/login' element={<div>Hello</div>} />
        <Route path='/Create-account' element={<div>Hello</div>} />
        <Route path='/forget-password' element={<div>Hello</div>} />
        <Route path='/Blogs' element={<div>Hello</div>} />
        <Route path='/Blogdetail' element={<div>Hello</div>} />
        <Route path='/Notics' element={<div>Hello</div>} />
        <Route path='/Business-Solutions' element={<div>Hello</div>} />
        <Route path='/Transport-Solutions' element={<div>Hello</div>} />
        <Route path='/Terms-and-conditions' element={<div>Hello</div>} />
        <Route path='/Privacy-policy' element={<div>Hello</div>} />
        <Route path='/List-your-vehicle' element={<div>Hello</div>} />
        <Route path='/Offers' element={<div>Hello</div>} />
        <Route path='/Car-Subscriptions' element={<div>Hello</div>} />
        <Route path='/Career' element={<div>Hello</div>} />


        {/* self drive */}
        <Route path='/Self-drive' element={<div>Hello</div>}>
          <Route path='car' element={<div>Car</div>} />
        </Route>


        {/* Taxi */}
        <Route path='/Taxi' element={<div>Hello</div>} />


        {/* Main Admin */}
        <Route path='/Admin' element={<div>Hello</div>}/>




      </Routes>
      <div id="preloader" />
      <a href="/" className="back-to-top">
        <i className="icofont-simple-up" />
      </a>
    </div>
  );
}

export default App;
